window.addEventListener('JWPlayerInit', function (e) {
  trackingSetup(e.detail.playerID);
}, false);

function trackingSetup(j) {
    var flagHasAd = false;
    var flagIsRunning = false;

    jwplayer(j).on('adImpression', function() {
        trackJwpEvent(this, &quot;init&quot;);
        trackJwpEvent(this, &quot;adImpression&quot;);
        flagHasAd = true;
    });

    jwplayer(j).on('play', function() {
        if (flagIsRunning == false){
            if (flagHasAd == false){
                trackJwpEvent(this, &quot;init&quot;);
	            trackJwpEvent(this, &quot;videostart&quot;);
                flagIsRunning = true;
            } 
            else{
	            trackJwpEvent(this, &quot;videostart&quot;);
                flagIsRunning = true;
            } 
        }
        else{
	         trackJwpEvent(this, &quot;resume&quot;);
        }
    }); 

    jwplayer(j).on('pause', function() {trackJwpEvent(this, &quot;pause&quot;);});

    jwplayer(j).on('complete', function() {
      trackJwpEvent(this, &quot;eof&quot;);
      flagIsRunning = false;
    });

    jwplayer(j).on('mute', function(e) {
        if (e.mute == true){trackJwpEvent(this, &quot;mute on&quot;);}
        else {trackJwpEvent(this, &quot;mute off&quot;);}
    });

    jwplayer(j).on('fullscreen', function(e) {
        if (e.fullscreen == true){trackJwpEvent(this, &quot;fullscreen on&quot;);}
        else {trackJwpEvent(this, &quot;fullscreen off&quot;);}
    });

    var pos1, pos2 = 0;
    var interval = 15;
    jwplayer(j).on('time', function(e) {
        pos1 = Math.floor(this.getPosition());
        if (pos1 != pos2) {
            pos2 = pos1;
            if (pos2 % interval == 0) {trackJwpEvent(this, &quot;pos&quot;);}
	}
    });
}

function trackJwpEvent(v, playerEvent) {
    var videoData = {
        mediaId: &quot;video: &quot; + v.getConfig().id,
        event: playerEvent,
        position: Math.floor(v.getPosition()).toString(),
        duration: v.getConfig().trackingDuration.toString(),       
        additionalParam : 
            &quot;mg1=&quot; + &quot;video&quot; + &quot;;&quot; +
            &quot;mg2=&quot; + &quot;&quot; + &quot;;&quot; +
            &quot;mg3=&quot; + v.getConfig().id + &quot;;&quot; +
            &quot;mg4=&quot; + v.getConfig().trackingTitle + &quot;;&quot; +
            &quot;mg5=&quot; + v.getConfig().copyright + &quot;;&quot; +
