/*
Mark Reddin, Tealium, 24July2017
Send Welt Subscription information to AudienceStream
While user is logged in, https://lo.la.welt.de/profile/subscriptions will return an array of subscription information like this
as the response
[{&quot;promotionId&quot;:&quot;000000010003018&quot;,&quot;purchasedInShop&quot;:&quot;WONP&quot;,&quot;shopKind&quot;:&quot;producer&quot;,&quot;subscriptionState&quot;:&quot;committed&quot;,&quot;from&quot;:1497909600000,&quot;to&quot;:1503179999000}]

We wish to query this once per session and pass the promotionId, and the from and to dates to AudienceStream

We need an authorization header to make the request successfully, but this cookie will exist by the time the collect tag fires
So this can just be an inline extension on the collect tag

It's somewhat complicated by the fact that we still need to make the request to the subscriptions URL asynchronously

Overall pattern
Set session cookie to remember that we have already sent the information to AS, don't bother with any of this if already sent in this session

If this is the original extension call, then cancel it, and call the tag again when the response from the subscription URL returns

If the response never returns, call the tag again anyway after 5 seconds

We can distinguish the original extension call versus the one we've called from the response because we are calling the latter with extra data
*/
//Set session cookie to remember that we have already sent the information to AS, don't bother with any of this if already sent in this session
//20180323
//Update Nicole Emer : Senden nur wenn Event &quot;user::loggedin&quot; und wenn utag_main ohne Eintrag &quot;subscription_fetched&quot;
if ( window.eventSystem !== undefined) {
eventSystem.registerEventListener(&quot;user::loggedin&quot;, function() {
if (document.cookie.includes(&quot;subscriptions_fetched:yes&quot;) === false) {
    //is this an original call to the tag, or is it via us calling back the tag in this extension?
    if (typeof(b.as_subscriptions_array) ==&quot;undefined&quot; &amp;&amp; typeof(utag.subscriptions_for_as_handled_already) == &quot;undefined&quot;) {
        var auth = utag.loader.RC('userdata');
        //if we don't have this, then just send the collect tag unaltered - we will try again on the next collect event
        if (auth.length &gt; 0) {
            var x = new XMLHttpRequest();
            x.open(&quot;GET&quot;, &quot;//lo.la.welt.de/profile/subscriptions&quot;, true);
            x.setRequestHeader('Authorization', 'Bearer ' + auth);
            //get a deep clone
            utag.tempUtagDataForSubscriptions = JSON.parse(JSON.stringify(b));
            utag.callCollectTagAgainForSubscriptions = function(subscriptionArray) {
                var b = utag.tempUtagDataForSubscriptions;
                if (subscriptionArray) {
                    b.as_subscriptions_array = subscriptionArray;
                }
                //call the utag using the same method again (view or link)
                utag[b['ut.event']](b, null, [9]);
//          console.log(&quot;done&quot;);
            };
            x.onreadystatechange = function() {
                var a;
                if (x.readyState == XMLHttpRequest.DONE &amp;&amp; x.status == 200) {
                    if (utag.subscription_timeout) {
                        window.clearTimeout(utag.subscription_timeout);
                        delete utag.subscription_timeout;
                    }
                    try {
                        a = JSON.parse(x.responseText);
                    } catch (e) {

                    } finally {
                        utag.callCollectTagAgainForSubscriptions(a);
                    }

                }
            };
            x.send();
            //in case we never get a response - this timeout is cleared in the code that handles a response above
            utag.subscription_timeout = setTimeout(function() {
                utag.callCollectTagAgainForSubscriptions();
            }, 5000);
            //we also don't need to react to any more calls to the collect tag on the same page, so remember that we've already handled it
            utag.subscriptions_for_as_handled_already = true;
            return false;
        }
    } else if (b.as_subscriptions_array) {
        delete utag.tempUtagDataForSubscriptions;
        try {
            if (b.as_subscriptions_array.length === 0) {
                b.as_promotion_id = &quot;NoSubscription&quot;;
                utag_data.as_promotion_id = &quot;NoSubscription&quot;;         
            } else {
                var s = b.as_subscriptions_array[0];
                b.as_promotion_id = s.promotionId;
                utag_data.as_promotion_id = s.promotionId;        
                var dateFrom = new Date(s.from);
                var dateTo = new Date(s.to);
                var utcTimestamp = function(d) {
                    return d.getUTCFullYear() + '-' + (parseInt(d.getUTCMonth()) + 1) + '-' + d.getUTCDate() + ' ' + d.getUTCHours() + ':' + d.getUTCMinutes() + ':' + d.getUTCSeconds();
                };
                //to convert from a date in AS, you can using a simple date format, but not from epoch milliseconds
                b.as_subscription_from = utcTimestamp(dateFrom);
                utag_data.as_subscription_from = utcTimestamp(dateFrom);          
                b.as_subscription_to = utcTimestamp(dateTo);
            utag_data.as_subscription_to = utcTimestamp(dateTo);
            }
        } catch (e) {}
        //Set session cookie to remember that we have already sent the information to AS, don't bother with any of this if already sent in this session
        utag.loader.SC(&quot;utag_main&quot;, {
            'subscriptions_fetched': &quot;yes&quot; + ';exp-session'
        });


    }
}
});
}

