function collectHomeTeasers() {
    function getArticleTeaser() {
        return document.getElementsByTagName('article');
    }


	function getTeaserName(articleTeaser) {
        for(var i = 0; i &lt; articleTeaser.getElementsByTagName('a').length; i++) {
            var currentLink = articleTeaser.getElementsByTagName('a')[i];
            if(!!currentLink.href &amp;&amp; !!currentLink.href.split('/article')[1]) {
                var teaserName = currentLink.href
                    .split('article')[1]
                    .split('/')[0];
                break;
            }
            else if(!!currentLink.href &amp;&amp; !!currentLink.href.split('/plus')[1]) {
                var teaserName = currentLink.href
                    .split('plus')[1]
                    .split('/')[0];
                break;
            }
            else if(!!currentLink.href &amp;&amp; !!currentLink.href.split('/sendung')[1]) {
                var teaserName = currentLink.href
                    .split('sendung')[1]
                    .split('/')[0];
                break;
            }
            else if(!!currentLink.href &amp;&amp; !!currentLink.href.split('/gallery')[1]) {
                var teaserName = currentLink.href
                    .split('gallery')[1]
                    .split('/')[0];
                break;
            }
        }
        if(!!teaserName) {
            return teaserName;
        }
        else {
            return false;
        }
    }

    function getTeaserRank(articleTeaser) {
        for(var i = 0; i &lt; articleTeaser.getElementsByTagName('a').length; i++) {
            var currentLink = articleTeaser.getElementsByTagName('a')[i];
            if(!!currentLink.getAttribute('name')) {
                var teaserRank = currentLink.getAttribute('name').split('_')[0];
                break;
            }
        }
        if(!!teaserRank) {
            return teaserRank;
        }
        else {
            return false;
        }
    }

    function getTeaserContent(articleTeaser) {
        for(var i = 0; i &lt; articleTeaser.getElementsByTagName('a').length; i++) {
            var currentLink = articleTeaser.getElementsByTagName('a')[i];
            if(!!currentLink.title) {
                var articleContent = currentLink.title;
                break;
            }
        }
        if(!!articleContent) {
            return articleContent;
        }
        else {
            return false;
        }
    }

    function getTeaserVariant(articleTeaser) {
        for(var i = 0; i &lt; articleTeaser.getElementsByTagName('a').length; i++) {
            var currentLink = articleTeaser.getElementsByTagName('a')[i];
            if(!!currentLink.getAttribute('name')) {
                var teaserVariant = '';
                var splitName = currentLink.getAttribute('name').split('_');
                if(splitName[splitName.length - 1] == '') {
                    teaserVariant = splitName[splitName.length - 2];
                }
                else {
                    teaserVariant = splitName[splitName.length - 1];
                }
                break;
            }
        }
        if(!!teaserVariant) {
            return teaserVariant;
        }
        else {
            return false;
        }
    }

    var articles = getArticleTeaser();
    for(var i = 0; i &lt; articles.length; i++) {
        var teaserName = getTeaserName(articles[i]);
        var teaserRank = getTeaserRank(articles[i]);
        var teaserContent = getTeaserContent(articles[i]);
        var teaserVariant = getTeaserVariant(articles[i]);
        if(!!teaserName &amp;&amp; !!teaserRank &amp;&amp; !!teaserContent &amp;&amp; !!teaserVariant) {
            window.wt_ttv2.push({
                selector: articles[i],
                data: {
                    name: teaserName,
                    rank: teaserRank,
                    content: teaserContent,
                    variant: teaserVariant
                },
                conversion: {
                    type: &quot;view&quot;,
                    goal: &quot;order&quot;,
                    value: &quot;default&quot;
                }
            });
        }
    }
}

